Ultra blended brunette 🤍

These finely woven highlights give the feel of an overall lighter color without the maintenance of a solid color. The results feel soft and glowy. Typical maintenance would be a toner every 3-4 months, but many clients enjoy the look once the toner fades and don’t even refresh. Bringing the highlights up would be required between 1-3 times a year depending on how rooted you enjoy your hair.

@wellahairusa #passionistaholidayhairchallenge

When to incorporate balayage when highlighting 👇🏽

I used a combination of babylights and balayage to give an overall lighter feel. I make the decision to add on a balayage when the ends begin feeling too diffused or dull. I foiled using 10vol to allow it to process slow enough to apply the balayage and have it process for 30mins — everything was rinsed out at the same time making it pain free! 

