Imagine being 14 and getting your hair done for the first time by a professional and it looking like this?? 😂 Who else went through the ugly phases like I did? DIY was all we knew — boxed color/bleach and no tutorials 🙈. Kids these days are so lucky!

This little beauty’s Mom has been my client since she was a toddler. It is such an amazing experience seeing her grow into a gorgeous, intelligent young lady — and also have the honor of coloring her hair for the first time 🤍

