Always up for a challenge ➡️ Swipe to see before

Client came in with chunky and brassy highlights. She wanted a very natural blend, so I first went in and did herringbone sectioning using a fine weave and Wella Blondor w/ 10vol. Once the foils were in place, I went in between the foils and applied Color Touch 5/0 to blur out the chunky existing highlights while leaving the ends untouched. Using a low developer with the lightener gave me time to apply the color and have enough time to process before needing to be washed out. I then toned everything down using Color Touch 9/0, 8/0 + 8/73 and then root shadowed with 5/0. 

